import Column from "../components/column/column"
import Bottom from "../components/bottom_player/bottom_player"
import Record from "../components/record"
import track1 from "../music/track1.mp3"
import track2 from "../music/track2.mp3"
import track3 from "../music/track3.mp3"
import track4 from "../music/track4.mp3"
import "./search.css"
import { Redirect } from 'react-router-dom'
import axios from "axios"
import {getFromStorage, setInStorage} from "../utils/storage"



export default function search() {
    // return <Redirect to='/login' />
    const token = {token: getFromStorage('the_main_app').token};
    if (token){
        //verify token
        console.log("token not null")
        const res = axios.post("http://localhost:5000/verify", token);
        if(res.data.Sucess){
                console.log("valid token")
                return (
                    <div className="container">
                        <p>here</p>
                    </div>
                );
            }
            return <Redirect to="/login"/>

    }
    return (
        <div className="container">
            <Column className="column"/>
            <Bottom className="bottom"/>

        </div>
    );

}
